    return (
      <div>
        <h2 className="text-xl font-semibold mb-4">Tasks</h2>
        {/* Task fields here */}
        <div className="flex justify-between mt-4">
          <button className="bg-gray-300 text-black px-4 py-2 rounded" onClick={prevStep}>Back</button>
          <button className="bg-blue-500 text-white px-4 py-2 rounded" onClick={nextStep}>Next</button>
        </div>
      </div>
    );
  };

  export default CardThree;
